  return (
    <form>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title :</label>
          <input type="text" onClick={changeTitleHandler}></input>
        </div>
        <div className="new-expense__control">
          <label>Amount :</label>
          <input type="number" min="0.01" step="0.01" onClick={amountChangeHandler}></input>
